import React, { useEffect, useRef, useState } from 'react'
import classnames from 'classnames'

const defaultFill = 'rgba(217,217,217,0.1)'
const defaultStroke = 'rgba(217,217,217,0.2)'

const updatePointPosition = (value) => {
  // Преобразование значения в угол от 0 до 360 градусов
  const angle = (value / 100) * 360
  // Преобразование угла в радианы
  const radians = angle * Math.PI / 180
  // Вычисление новых координат для точки
  const x = 212.5 + 107.837 * Math.cos(radians)
  const y = 245.5 + 107.837 * Math.sin(radians)

  // Установка новых координат для точки
  return { x, y }
}

/* eslint-disable max-len */

interface IProps {
  score: number,
  speed: number,
}

