  const pointRef = useRef<any>(null)
  const [pointPosition, setPointPosition] = useState({
    x: 0,
    y: 0,
  })

  const getCurrentRange = score => {
    if (score <= 20) {
      return 0
    }

    if (score <= 40) {
      return 1
    }

    if (score <= 60) {
      return 2
    }

    if (score <= 80) {
      return 3
    }

    return 4
  }

  const rate = getCurrentRange(score)

  const isFirst = rate === 0
  // const isFirst = true
  const isSecond = rate === 1
  const isThird = rate === 2
  const isFourth = rate === 3
  const isFiveth = rate === 4

